webpackJsonp([0x7bda21e66bc1],{963:function(t,e){t.exports={data:{markdownRemark:{html:"<p>It's rare that you see much criticism of nonprofit organizations. People are getting <em>something</em> done, after all, no matter what particulars you may take affront to their modus operandi. </p>\n<p>But we should all be wary of the thought-stifling, fuzzy-feeling environment that lets fundamental missions go unexamined. And it's in that spirit I that I so much appreciate David Geilhufe's recent frustrations with the increasingly for-profit nature of <a href=\"http://www.nten.org/\">N-TEN's</a> national conference.  </p>\n<p>You can find his post here:   <a href=\"http://blog.social-source.com/2005/03/where-have-values-gone.html\">Social Source Software: Where Have The Values Gone?</a></p>",frontmatter:{created_at:"May 03, 2005",path:"/2005/05/03/for-profit-nten",title:"For-Profit NTEN?",tags:["nten","nptech"]}}},pathContext:{}}}});
